def permutations(string):
    array_string = list(string)
    posib =[]
    letter_use =""
    #first mix
    for i in range(len(string)):#each word
        array_string = list(string)
        letter_use = array_string.pop(i)

        for j in range(len(array_string)+1):#each letter
            array_string.insert(j,letter_use)
            posib.append("".join(array_string))
            array_string.pop(j)

    #second mix
    posib_2 = list(posib)
    for words in posib_2:
        array_string = list(words)
        for i in range(len(string)):
            letter_use = array_string.pop(0)
            array_string.append(letter_use)
            posib.append("".join(array_string))
    posib_2  = ["".join(reversed(list(word))) for word in posib]
    posib += posib_2
    return list(set(posib))
# cadb
